import React from 'react';
import Plot from 'react-plotly.js';

const DataPlot = (users, total_points) => {
    var y0 = total_points;
    var y1 = users;
    for (var i = 0; i < 50; i ++) {
        y0[i] = Math.random();
    }

    var d1 = {
        y: y0,
        type: 'box'
    };

    return (
        <Plot
          data={[d1]}
          layout={ {title: 'Plot'} }
        />
      );
}

export default DataPlot;
